import React from "react";
import {Nav} from "react-bootstrap";
import { withRouter } from "react-router";
import logo from '../logo.svg'
import logout from '../logout.svg'
import {Link} from 'react-router-dom'
import "./Sidebar.css";

const Side = props => {
   

    return (
        <div id="sidebar">
    
            <Nav className="col-md-12 d-none d-md-block sidebar">
                <div className="sidebar-sticky"><Link to="/doctor"> <img className= "sidebar-icon" src={logo} alt="icon"/></Link></div>
            <Nav.Item>
                <Nav.Link href="/home" className="side_link">Dashboard</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1" className="side_link">Schedule</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-2" className="side_link">Patient</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-3" className="side_link">Generics</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Link to ="/" className="nav-link"><img src={logout} width="15" height="25"className="d-inline-block align-top"/></Link>
            </Nav.Item>
            </Nav>
          
        </div>
        );
  };
  const Sidebar = withRouter(Side);
  export default Sidebar
